import React from 'react';

const Privacy = () => {
    return <div className='putMargin'> 
        <h1>PRIVACY</h1>
      We know that you care how information about you is used and shared, and we appreciate your trust that we will do so carefully and sensibly. This Privacy Notice describes how QuillingArt.com collect and process your personal information through Quilling Art websites, devices, products, services, online and physical stores, and applications that reference this Privacy Notice.By using Amazon Services, you are consenting to the practices described in this Privacy Notice.
  </div>;
};

export default Privacy;
